import React from 'react';
import Nav from './components/Nav/Index';
import MainContainer from './components/Main-Container/index';

import './App.css';

function App() {
  return (
    <div className="App">
      <>
        <Nav />
      </>
      <MainContainer />
    </div>
  );
}

export default App;
